style.css:
@-moz-document domain(programs.cu.edu.ge) {
	body,
	.bg-2,
	.bg-3 {
		color: white;
		background-color: #23232d;
	}
	.bg-1 {
		background-image: linear-gradient(#162a3e, #23232d)
	}
	.panel-default>.panel-heading {
		background-color: #23232d !important
	}
	.panel-default>.panel-heading+.panel-collapse>.panel-body {
		padding: 1%;
	}
	.radio {
		padding-left: 1.5%;
	}
	.grade {
		background-color: #23232d;
	}
	td>.myaccount {
		border: 1px solid #23232d;
		background-image: linear-gradient(#162a3e, #23232d);
		border-radius: 0 30px 30px 0;
	}
	.payment {
		background-color: #23232d;
	}
	.form-control {
		background-color: #23232d;
		color: white;
	}
	.titlehdr {
		color: lightgray;
		border-bottom: 1px solid lightgray;
		padding-bottom: 6px;
		text-align: center;
	}
	.titlehdr2 {
		color: lightgray;
		border-bottom: 1px solid lightgray;
		padding-bottom: 6px;
	}
	td>.titlehdr {
		color: lightgray;
		border-bottom: 1px solid lightgray;
		padding-bottom: 6px;
		text-align: center;
	}
	tbody>tr>td:nth-child(2) {
		padding-left: 8px;
	}
	.forms {
		border: 1px solid #23232d;
	}
	* {
		background-color: #23232d;
		color: white
	}
	#carieli,
	p,
	strong {
		background-color: transparent;
	}
	.style4,
	.style5,
	.style6,
	.style61,
	.style78,
	.style81,
	.style10,
	.style73,
	#app-block h3,
	.style741,
	div>.style41,
	p>span {
		color: white;
	}
	tr>.style78 {
		color: white;
	}
	.submit_masala {
		color: darkgray;
	}
	tr td input {
		text-align: center;
	}
	tr td form {
		margin-top: 6.5px;
		margin-bottom: 6.5px;
	}
	table tbody tr td .style4 {
		text-align: center;
	}
	td span form {
		text-align: center;
	}
	p .titlehdr {
		border-bottom: 1px solid transparent;
	}
	input {
		border-radius: 32px;
		border-width: thin;
	}
	body table tbody tr td table tbody tr td:nth-child(1) {
		padding-left: 3px;
		padding-right: 4px;
	}
	input[value="GPA-ის გამოთვლა"] {
		float: right;
		margin: 0 4px 8px 0;
	}
	.submit_cyl {
		background-color: #23232d;
		color: white;
	}
	.myaccount a:hover {
		color: lightgray;
		text-decoration: none;
		margin-left: 3px;
	}
	table tbody tr td a:hover {
		color: lightgray;
		text-decoration: none;
		margin-left: 3px;
	}
	.btn-primary {
		background-color: transparent;
	}
	input[value="მასალების ჩამოტვირთვა"] {
		color: #fff;
		background-color: transparent;
		border-color: #2e6da4;
		display: inline-block;
		padding: 6px 12px;
		margin-bottom: 0;
		font-size: 14px;
		font-weight: 400;
		line-height: 1.42857143;
		text-align: center;
		white-space: nowrap;
		vertical-align: middle;
		-ms-touch-action: manipulation;
		touch-action: manipulation;
		cursor: pointer;
		-webkit-user-select: none;
		-moz-user-select: none;
		-ms-user-select: none;
		user-select: none;
		background-image: none;
		border: 1px solid #2e6da4;
		border-radius: 4px;
		text-decoration: none;
	}
	input[value="მასალების ჩამოტვირთვა"]:hover {
		background-color: #2e6da4;
	}
	.form-control {
		background-color: #23232d !important;
		color: white !important;
		border: 1px solid gray !important;
	}
	#login_form input {
		background-color: #23232d !important;
		color: white !important;
		border: 1px solid gray !important;
	}
}
